import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different wait strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });
    await page.waitForSelector('body', { timeout: 5000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if modal is already open, if not try to open it
    const modalVisible = await page.$eval('.modal', el => window.getComputedStyle(el).display !== 'none');

    if (!modalVisible) {
      // Try to open modal by clicking a product card
      await page.waitForSelector('.product-card', { timeout: 5000 });
      await page.click('.product-card:first-of-type');
      await page.waitForTimeout(1000); // Brief wait for modal animation
    }

    // Press Escape key to close modal
    await page.keyboard.press('Escape');

    // Wait for modal to be hidden and verify it's closed
    await page.waitForFunction(() => {
      const modal = document.querySelector('.modal');
      return modal && window.getComputedStyle(modal).display === 'none';
    }, { timeout: 5000 });

    // Take screenshot after closing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_closed.png'));

    return {
      success: true,
      action: "Successfully closed modal using Escape key",
      extractedData: { modalClosed: true },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
